import axios from "axios";
import { useEffect } from "react";

const apiCall=()=>  {
useEffect(() => {
    axios.get(props.url)
      .then(response => {
        return response.data;
      })
      .catch(error => {
        console.error(error);
      });
  }, []);


}
export default ApiCall;
